import axios from 'axios';
import React, { useState } from 'react'
import { Button, Form } from 'react-bootstrap';
import { useParams } from 'react-router-dom';

const EditarAgricultor = () => {
    this.state={
        nombres: '',
        apellidos: '',
        correo: '',
        agremiacion: '',
        matriculai: '',
        rut: ''
    }

    function handleInputChange(e) {
        this.setState({
          [e.target.name]: e.target.value
        })
    }

    let { id } = useParams();
    console.log(id); 

    let url = 'http://localhost:4000/agricultor/' + id;
    console.log(id);
    axios.get(url).then(res => {console.log(url)
        this.setState({ status: true });

    });


  return (
    <div>
    <Form onSubmit={this.onSubmit}>
    <Form.Group controlId="nombres">
      <Form.Label>Nombres</Form.Label>
      <Form.Control
         type="text"
         value={this.state.nombres}
         onChange={handleInputChange}
       />
     </Form.Group>

        <Form.Group controlId="apellidos">
          <Form.Label>Apellidos</Form.Label>
          <Form.Control
            type="text"
            value={this.state.apellidos}
            onChange={handleInputChange}
          />
        </Form.Group>

        <Form.Group controlId="correo">
          <Form.Label>Correo</Form.Label>
          <Form.Control
            type="text"
            value={this.state.correo}
            onChange={handleInputChange}
          />

        </Form.Group>

        <Form.Group controlId="cedula">
          <Form.Label>Cedula</Form.Label>
          <Form.Control
            type="text"
            value={this.state.cedula}
            onChange={handleInputChange}
          />
        </Form.Group>

        <Form.Group controlId="contraseña">
          <Form.Label>Contraseña</Form.Label>
          <Form.Control
            type="text"
            value={this.state.contraseña}
            onChange={handleInputChange}
          />
        </Form.Group>

        <Form.Group controlId="agemiacion">
          <Form.Label>Agremiacion</Form.Label>
          <Form.Control
            type="text"
            value={this.state.agremiacion}
            onChange={handleInputChange}
          />

        </Form.Group>
        <Form.Group controlId="matriculai">
        <Form.Label>Matricula I</Form.Label>
        <Form.Control
          type="text"
          value={this.state.matriculai}
          onChange={handleInputChange}
        />

      </Form.Group>
      <Form.Group controlId="Rut">
      <Form.Label>Rut</Form.Label>
      <Form.Control
        type="text"
        value={this.state.rut}
        onChange={handleInputChange}
      />

    </Form.Group>

        <Button
          variant="danger"
          size="lg"
          block="block"
          type="submit"
          className="mt-4"
        >
          Crear Agricultor
        </Button>
      </Form>  

    </div>
  )
}

export default EditarAgricultor
